import React from "react";

const Category = () => {
  const categories = [
    { img: "img/category/macbook.jpg", name: "Ноутбуки" },
    { img: "img/category/huaweipura70.jpg", name: "Смартфоны" },
    { img: "img/category/TVHorizont.jpg", name: "Телевизоры" },
    { img: "img/category/notepad.jpg", name: "Планшеты" },
    { img: "img/category/jblgo4.jpg", name: "Колнки" },
  ];

  return (
    <div className="category">
      <div className="category_title">Каталог</div>
      <div className="category_list">
        {categories.map((category, index) => (
          <div className="category_card" key={index}>
            <div className="category_img">
              <img src={category.img} alt={category.name} />
            </div>
            <div className="category_opis">{category.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Category;
